import React from "react";
import { useStats } from "../hooks/useStats";

function Stats() {
  const stats = useStats();
  console.log(stats);

  return <section>Stats:</section>;
}

const IndexPage = props => {
  return (
    <main>
      <Stats />
    </main>
  );
};

export default IndexPage;
